import React, { useState } from "react";

const ContactPage = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    category: "Support",
    description: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Données soumises :", formData);
    alert("Votre demande a été envoyée avec succès !");
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-6">
      <h1 className="text-4xl font-bold mb-6">Contactez-nous</h1>
      <p className="text-lg text-gray-600 mb-6">Remplissez ce formulaire pour nous contacter.</p>

      <form onSubmit={handleSubmit} className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4 w-full max-w-lg">
        {/* Section 1: Informations personnelles */}
        <h2 className="text-xl font-semibold mb-4">Informations personnelles</h2>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2">Nom</label>
          <input name="name" value={formData.name} onChange={handleChange} required className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700" type="text" placeholder="Votre nom" />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2">Email</label>
          <input name="email" value={formData.email} onChange={handleChange} required className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700" type="email" placeholder="Votre email" />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2">Téléphone</label>
          <input name="phone" value={formData.phone} onChange={handleChange} required className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700" type="tel" placeholder="Votre numéro de téléphone" />
        </div>

        {/* Section 2: Catégorie de la demande */}
        <h2 className="text-xl font-semibold mt-6 mb-4">Catégorie de la demande</h2>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2">Sélectionnez une catégorie</label>
          <select name="category" value={formData.category} onChange={handleChange} className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700">
            <option value="Support">Support</option>
            <option value="Partenariat">Partenariat</option>
            <option value="Autre">Autre</option>
          </select>
        </div>

        {/* Section 3: Description de la demande */}
        <h2 className="text-xl font-semibold mt-6 mb-4">Description de la demande</h2>
        <div className="mb-6">
          <label className="block text-gray-700 text-sm font-bold mb-2">Détaillez votre demande</label>
          <textarea name="description" value={formData.description} onChange={handleChange} required className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700" rows="4" placeholder="Expliquez votre demande..."></textarea>
        </div>

        <button className="bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded-full font-semibold" type="submit">
          Envoyer la demande
        </button>
      </form>

      <a href="/" className="text-blue-600 hover:text-blue-800">Retour à l'accueil</a>
    </div>
  );
};

export default ContactPage;
